import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [items, setItem] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3000', {
      headers: {
        'Content-Type': 'application/json'
      }
    })
      .then(res => res.json())
      .then(item => setItem(JSON.stringify(item)));
  });

  return (
    <div className="App">
      <p>bonjour</p>
      {items.map(i => <p>{i.title}</p>)}
    </div>
  );
}

export default App;
